import { useEffect, useState } from "react";
import { useSelector } from "react-redux";
import { RootState } from "../../redux/store/store";
import { api } from "../../util/api";
import { styled } from "styled-components";
import { ApiStackData } from "../../type/aboutRedux";

type ContainerProps = {
  displayOpt: boolean|ApiStackData[]
}

export default function FolderOfStack() {
  const [apiStack, setApiStack] = useState<ApiStackData[]|boolean>(false);
  const stack = useSelector((state: RootState) => state.stack.stack);

  useEffect(() => {
    const dataOfStack = api.get("");
    setApiStack(false);
  }, [stack]);  


  return <Container displayOpt={apiStack}>
    {!apiStack && <NoneData>데이터가 없습니다.</NoneData>}
  </Container>;
}

const Container = styled.div<ContainerProps>`
  width: 100%;
  display: grid;
`


const NoneData = styled.div`
  color: white;
  font-size: 30px;
`
